<html>
      <head>
        <meta name="viewport" content="width=device-width, initial-scale=1">
      </head>
      <body>
        <style>
  *, 
  *:before, 
  *:after{
    box-sizing: border-box;
  }
  :root{
    --card-radius: 16px;
  }
  html, body{
    padding: 0;
    margin: 0;
    width: 100%;
    height: 100%;
  }
  body{
    background: #24292B;
  }
  .viewer{
    position: fixed;
    perspective: 1000px;
    perspective-origin: 50% 50%;
    left:50%;
    top: 50%;
    transform: translate(-50%,-50%);
  }
  .card{
    transform-style: preserve-3d;
    -webkit-transform-style: preserve-3d;
    perspective: 1000px;
  }
  .card-front,
  .card-back{
    will-change: transform,filter, box-shadow,z-index;
    padding: 4px;
    -webkit-backface-visibility: hidden;
    backface-visibility: hidden;
    position:relative;
    border-radius: var(--card-radius);
    overflow: hidden;
  }
  body:after{
    content:'';
    background: rgba(0,0,0,0);
    position: absolute;
    left: 0;
    right: 0;
    top: 0;
    bottom: 0;
    will-change: backdrop-filter;
    backdrop-filter: blur(0.2px);
    -webkit-backdrop-filter: blur(0.15px);
  }
  .card-art svg.label,
  .card-art svg.art,
  .card-back .card-art>svg{
    will-change: filter;
    filter: url("#chromatic-aberration");
    -webkit-filter: url("#chromatic-aberration");
  }
  .card-art {
    border-radius: calc(var(--card-radius) * 0.75);
    overflow: hidden;
    position: relative;
    z-index: 1;
  }
  .card-back{
    transform: rotateY(180deg);
    position: absolute;
    left: 0;
    top: 0;
  }

.card .shine{
  position: absolute;
  left:0;
  top:0;
  right: 0;
  bottom: 0;
  border-radius: var(--card-radius);
  background-image: radial-gradient(circle at 50% 50%, rgba(255,255,255,0.5),rgba(255,255,255,0));
  background-size: 100% 100%;
  background-position: 50% 50%;
  background-repeat: no-repeat;
  z-index:3;
}

.card .border{
  position: absolute;
  left:0;
  top:0;
  right: 0;
  bottom: 0;  
  background: rgba(255,255,255,0.5);
  z-index: 0;
}
.card .border:after{
  content: '';
  position: absolute;
  left: 0;
  top: 0;
  width: 0;
  height: 0;
  animation: borderShine 10000ms linear infinite;
  box-shadow: 0 0 40px 40px rgba(255,255,255,1),0 0 40px 40px rgba(255,255,255,1);
  will-change: transform;
  transform: translateX(-50%) translateY(-50%);
  mix-blend-mode: overlay;
}

.card--autospin{
  animation: cardSpin 6s linear infinite;
}

@keyframes borderShine{
  from{
   transform: translateX(-50%) translateY(-50%);
  }
  25%{
    transform: translateX(calc(272px - 50%)) translateY(-50%);
  }
  50%{
    transform: translateX(calc(272px - 50%)) translateY(calc(360px - 50%));
  }
  75%{
    transform: translateX(-50%) translateY(calc(360px - 50%));
  }
}

  @keyframes cardSpin{
    0%{
      transform: rotateY(0deg);
    }
    100%{
      transform: rotateY(360deg);
    }
  }

</style>

<script>
  function hoverFx( object, move, leave ) {

    move = move || function(){}
    var frameId = null
  
    const frameListener = (e) => {
      animationFrameID = requestAnimationFrame(frameListener)
    }
  
    const mouseMove = (e) => {
      cancelAnimationFrame(frameId)
        frameId = requestAnimationFrame(() => {
        var data = {
          rect: object.getBoundingClientRect(),
          mouseX: e.clientX,
          mouseY: e.clientY
        }
        data.xPercent = Math.abs(data.rect.x - data.mouseX)/data.rect.width * 100
        data.yPercent = Math.abs(data.rect.y - data.mouseY)/data.rect.height * 100
        move(object,data)
        });
    }
    const mouseLeave = (e) => {
      if(typeof leave === "function"){
        leave(object)
      }
    }
    object.addEventListener('mousemove', mouseMove)
    object.addEventListener('mouseleave', mouseLeave)
  
  }
</script>
<script>
  let card = document.querySelector(".card")
  let cardFront = card.querySelector(".card-front")
  let cardBack = card.querySelector(".card-back")
  let cardShineFront = cardFront.querySelector(".shine")
  let cardShineBack = cardBack.querySelector(".shine")
  let rotateY = 0
  let rotateX = 0
  let autoSpin = true
  let hoverTimeoutId
  
  card.classList.add('card--autospin')
  
  let rotate = () => {
    if(autoSpin){
      rotateY = rotateY % 360 + 1
      rotateX = rotateX - 1 > 0? rotateX - 1: (rotateX + 1 < 0? rotateX + 1: 0)
    }
    card.style.transform = `rotateY(${rotateY}deg) rotateX(${rotateX}deg)`
    
    cardShineFront.style.backgroundImage = `radial-gradient(circle at ${-rotateY/45 * 360 + 50}% ${rotateX/45 * 360 + 50}%, rgba(255,255,255,0.75) 0%, rgba(255,255,255,0.25) 0%, rgba(255,255,255,0) 100%)`
    
    cardShineBack.style.backgroundImage = `radial-gradient(circle at ${-(rotateY % 180)/45 * 360 + 50}% ${rotateX/45 * 360 + 50}%, rgba(255,255,255,0.75) 0%, rgba(255,255,255,0.25) 0%, rgba(255,255,255,0) 100%)`
   
    let shadowIntensity = Math.abs(1 - Math.abs(rotateY % 180)/90)
    cardBack.style.boxShadow = cardFront.style.boxShadow = `${Math.abs(rotateY)%90/10}vw ${Math.abs(rotateX)%90/2 + 6}vw 5vw -${6 * shadowIntensity}vw rgba(0,0,0,${shadowIntensity})`
    
      
    //window.requestAnimationFrame(rotate)
  }

  //window.requestAnimationFrame(rotate)
  
  hoverFx(document.documentElement,(object,data) => {
    let {xPercent, yPercent} = data
    rotateY = -(xPercent - 50) * 6
    rotateX = -(yPercent - 50) 
    autoSpin = false
    card.classList.remove('card--autospin')
    rotate()
    clearTimeout(hoverTimeoutId)
    hoverTimeoutId = setTimeout(() => {
      //autoSpin = true
      card.classList.add('card--autospin')
    },1000)
  })
  
  
  </script>
